import React from 'react';
import SoundTile from './SoundTile';

const UrbanPage = () => {
  return (
    <div className="page" style={{ backgroundColor: 'gray', height: '100vh' }}>
      <SoundTile sound="Traffic" />
      <SoundTile sound="People" />
      <SoundTile sound="Rain" />
      <SoundTile sound="Wind" />
      <SoundTile sound="Pigeons" />
    </div>
  );
};

export default UrbanPage;
